  \"2013-03-15T23:31:44.124525\",\n\t\"name\": \"preliminary-test-results-and-geology-of-the-doe-superior-hulin-number-1-geopressured-geothermal\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The DOE/Superior Hulin #1 well is the most
  recent of the current three geopressured-geothermal prospects being tested by the
  Department of Energy (DOE) under its geopressured-geothermal program initiated in
  1975. The other prospects under evaluation are Gladys McCall #1 (Cameron Parish,
  Louisiana) and Pleasant Bayou #2 (Brazoria County, Texas). The main objective of
  this research program is to evaluate the commercial viability of energy production
  from high temperature (275+F), geopressured, natural-gas-saturated brine sandstone
  aquifers occurring in the Gulf Coast area.\",\n\t\"license_title\": null,\n\t\"extras\":
